func lengthOfLongestSubstring2(s string) int {

	//记录最大长度
	maxLen := 0
	//将字符串转换成rune切片
	runeStr := []rune(s)
	//滑动窗口
	start := 0
	end := 0
	tmpRuneStr := runeStr

	for _, char := range runeStr {

		flag := strings.Index(string(tmpRuneStr[start:end]), string(char))

		//未包含，滑动窗口右侧增加1;否则，滑动窗口左侧设置为重复字符的后一位
		if flag == -1 {

			end++
			continue

		}else {

			if end - start > maxLen {
				maxLen = end - start
			}

			end++
			start = start + flag + 1

		}

	}

	if end - start > maxLen {
		maxLen = end - start
	}

	return maxLen

}
